import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      counter: 0,
    };
  }

  increment = () => {
    this.setState((state) => ({
      counter: state.counter + 1,
    }));
  };

  render() {
    const { increment, decriment, random, reset } = this.props;
    return (
      <div className="app">
        <div className="counter">10</div>
        <div className="controls">
          <button>INC</button>
          <button>DEC</button>
          <button>RND</button>
          <button>RESET</button>
        </div>
      </div>
    );
  }
}
export default App;
